import Slider from "react-slick";
import * as img from "../../Assets/Gallery/index";
function Gallery() {
    const options = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1,
    }

    return(
        <main>
            <div className="slider-container">
                <Slider {...options} >
